const Cake = ({cake}) => {

  const arrayOfIngredients = cake.ingredients.map(ingredients => {
    return <li>{ingredients}</li>
})

  return (
    <>
        <h2>{cake.cakeName}</h2>
        <p>Ingredients:
        <ul>{arrayOfIngredients}</ul>
        </p>
        <p>Price: {cake.price}</p>
        <p>Rating: {cake.rating}</p>
    </>
  )
}

export default Cake;
